import React from 'react';
import { Container, Row } from 'react-bootstrap';
 
const layout = (props) => {
    return (
        <Grid>
            <Row>
                This is the place for the navigation component.
            </Row>
            <main>
                {props.children}
            </main>
        </Grid>
    )
}
export default layout;
